import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

import About from '../../pages/About/About';
import Home from '../../pages/Home/Home';
import Links from '../../pages/Links/Links';

import home_button_pic from '../../assets/images/home_button_pic.png';

import './Navbar.css';

function Navbar() {
    return (
        <BrowserRouter>
            
            <div id="navbar-body">
                <div id="home-button">
                    <Link to="/Jacob-Lin"><img src={home_button_pic} alt="Home" width="50" height="50"/></Link>
                </div>
                <nav id="navbar-text">
                    <Link to="/Jacob-Lin/About">About</Link>
                    <Link to="/Jacob-Lin/Links">Links</Link>
                </nav>
            </div>
            <Routes>
                <Route path="Jacob-Lin" element={<Home />} />
                <Route path="/Jacob-Lin/About" element={<About />} />
                <Route path="/Jacob-Lin/Links" element={<Links />} />
            </Routes>
        </BrowserRouter>
    )
}

export default Navbar;
